import logo from './logo.svg';
import './App.css';
import {Button, Layout, Slider, Footer, Header} from "antd";


function App() {
  return (
    <div className="App">
      <Layout>
        <Slider>Sider</Slider>
     <Layout>
      <Header>Header</Header>
      <Content>Content</Content>
      <Footer>Footer</Footer>
      </Layout>
      </Layout>
     <Button type="primary">Envoyer</Button>

    </div>
  );
}

export default App;
